import Blog from "./Blog";

const Post = () => {
    // let i = 0;
    const x = Blog.map(x =>
        <div key={x._id}>
            <p>id: {x._id}</p>
            <p>title: {x.title}</p>
            <p><a href={x.link}>link:</a> </p>
            <p>image: {x.image}</p>
            <p>date: {x.date}</p>
            <p>content: {x.content}</p>
            <p>comments: {x.comments}</p>
            <p>category: {x.category}</p>
        </div>
    );

    console.log(x);
    return <div>
        {x}

    </div>;
}

export default Post;




